This is a counter of time elapsed from the time that permanent battery power was applied to the instrument pack. This signal is incremented every 100 ms, and has a scaling of 100 ms per bit with zero offset. If power is removed, the previously-stored value will be retained. At maximum value (FFFFFFFE), the counter will roll over to zero. FFFFFFFF is defined as 'Correct value not available' by the Generic Global Diagnostic Specification. (This signal has to be read/written as bytes, because Volcano 5 does not support 32-bit unsigned values.) Note, no encoding information is permitted for this signal because it is a 'bytes' type signal and cannot be directly interpreted as an integer.
This signal shall be set as a Constant = 0xFFFFFFFF, whenever MinuteCounter is not available as a Network Signal.
The MSB of the signal must be written to the COM layer first (with an offset of zero in wr_bytes() ) and therefore transmitted on the bus first. Similarly, subscribing modules will receive the MSB of the signal when they call rd_bytes(0).
E.g. wr_bytes(0) = published_signal_MSB;
Subscribed_Signal_MSB = rd_bytes(0);

EuCD Signal. Range: 0 - 16777214 (0-FFFFFEh) Resolution: 1 KM FFFFFFh = Invalid Data
NB: Signals greater than 16bits have to be of Signal Type (Bytes) as VSX does not support Unsigned signals >16bits.
The MSB of the signal must be written to the COM layer first (with an offset of zero in wr_bytes() ) and therefore transmitted on the bus first. Similarly, subscribing modules will receive the MSB of the signal when they call rd_bytes(0).
E.g. wr_bytes(0) = published_signal_MSB;
