Common signal publishes by BCM XCL, replacing the individual MS and HS version

This signal contains PTSignalConfigID and GGDS Snapshot Data for the PT-HSCAN Network. This signal is compiled in accordance with the Car Configuration EuCD - Vehicle Information Parameters Specification 31812331.
The Publisher of this signal shall read its local constant PTSignalConfigID and shall copy the value to the correct Block and Offset of VehicleInfoParameters that carries PTSignalConfigID [Block 01h, Bytes 7-8].
The Publisher of this signal shall subscribe to various Source Signals from the Network that shall be used to compile the GGDS Global Snapshot data within VehicleInfoParametersPT. The Source Signals that shall be used to compile the GGDS Global Snapshot data are defined in the Network Specific Requirements document.
The MSB of the signal must be written to the COM layer first (with an offset of zero in wr_bytes() ) and therefore transmitted on the bus first. Similarly, subscribing modules will receive the MSB of the signal when they call rd_bytes(0).
E.g. wr_bytes(0) = published_signal_MSB;
Subscribed_Signal_MSB = rd_bytes(0);
